import React from 'react';
import OperatorButton from './OperatorButton';
import './Button.css';

const NumberButton = props => {
  return (
    <div className="col-md-4 d-inline-flex">
    {props.number}
    <div>{props.operator}</div>
    </div>
  );
};

export default NumberButton;
